import React from 'react';

const Home = () => {
  return (
    <section className="home" id="home">
      <div className="row">
        <div className="content">
          <h3>giảm tới 75%</h3>
          <p>pet đẹp, ngoan, dễ nuôi Đừng bỏ lỡ cơ hội mua pet đẹp chất lượng !.</p>

          <a href="#" className="btn">mua ngay</a>
        </div>

        <div className="swiper books-slider">
          <div className="swiper-wrapper">
            <a href="#" className="swiper-slide"><img src="image/banner1.jpg" alt="" /></a>
            <a href="#" className="swiper-slide"><img src="image/banner2.jpg" alt="" /></a>
          </div>
          <img src="image/stand.png" className="stand" alt="" />
        </div>
      </div>
    </section>
  );
};

export default Home;

